import React, { useEffect, useState } from 'react';
import Icon from './app/components/Icon';
import ListItem from './app/components/lists/ListItem';
import Screen from './app/components/Screen';
import ListingDetailsScreen from './app/screens/ListingDetailsScreen';
import MessagesScreen from './app/screens/MessagesScreen';
import MyAccountScreen from './app/screens/AccountScreen';
import ViewImageSceen from './app/screens/ViewImageSceen';
import AccountScreen from './app/screens/AccountScreen';
import ListingsScreen from './app/screens/ListingsScreen';
import AppTextInput from './app/components/AppTextInput';
import AppPicker from './app/components/AppPicker';
import LoginScreen from './app/screens/LoginScreen';
import RegisterScreen from './app/screens/RegisterScreen';
import ListingEditScreen from './app/screens/ListingEditScreen';
import TestScreen from './app/screens/TestScreen';
import * as ImagePicker from 'expo-image-picker';
import { Button, Image, Text } from 'react-native';
import ImageInput from './app/components/ImageInput';
import ImageInputList from './app/components/ImageInputList';
import { createStackNavigator } from '@react-navigation/stack';
import { NavigationContainer, useNavigation } from '@react-navigation/native';
const ScreenA = ({ route }) => {
  return (
    <Screen>
      <Text>ScreenA</Text>
      <Text>{route.params.id}</Text>
    </Screen>
  );
};
const ScreenB = () => {
  const navigation = useNavigation();
  return (
    <Screen>
      <Text>ScreenB</Text>
      <Button
        title="Go to screen A"
        onPress={() => {
          navigation.navigate('ScreenA', { id: 1 });
        }}
      />
    </Screen>
  );
};

const Stack = createStackNavigator();
const StackNavigator = () => {
  return (
    <Stack.Navigator initialRouteName="ScreenB" screenOptions={{headerBackground: "pink"}}>
      <Stack.Screen
        name="ScreenA"
        component={ScreenA}
        options={({ route }) => {
          return { title: route.params.id };
        }}
      />
      <Stack.Screen
        name="ScreenB"
        component={ScreenB}
        options={{ headerStyle: { backgroundColor: 'coral', elevation: 1 }, headerTintColor:"white" }}
      />
    </Stack.Navigator>
  );
};

export default function App() {
  return (
    <NavigationContainer>
      <StackNavigator />
    </NavigationContainer>
  );
}
